const linkStyle= {
  backgroundColor:"oldlace"
}
class FoldOverItem2 extends Component {
    render() {

      return (
        <div className="linksContainer">
        <a style={linkStyle} href={'https://www.instagram.com/jamesmedina7787/'} alt="James Medina JWM Porfolio">
         <img style={imgStyle} src={ig}/><br/>
          <br />
            <br/>
